INSERT INTO `tblposts` (`id`, `PostTitle`, `Category`, `PostDetails`, `PostingDate`, `UpdationDate`, `Is_Active`, `PostUrl`, `PostImage`) VALUES
(20, 'Pemkot Surabaya Siapkan Kajian Sosial Ekonomi Penerapan PSBB', 'Berita', '<p>Pemerintah Kota Surabaya akan berupaya menyelesaikan kajian-kajian sosial ekonomi hari ini, Senin (20/4/2020), jika sebelum nantinya Gubernur Jatim mengajukan Pembatasan Sosial Berskala Besar (PSBB) Kementerian Kesehatan untuk menanggulangi wabah Covid-19.</p><p><br></p><p>Muhammad Fikser Kadis Kominfo Kota Surabaya mengatakan, saat ini Pemkot mendata ada 35 ribu Masyarakat Berpenghasilan Rendah (MBR) di Surabaya dan angka tersebut masih berpotensi terus meningkat, yang harus diperhatikan saat penerapan PSBB.</p><p><br></p><p>Pemerintah kota sedang menyiapkan peta penyebaran yang ada di Surabaya. Terus bagaimana dengan sosial ekonomi, hari ini akan kami selesaikan lalu kita sampaikan ke Gubernur sebelum meneruskannya ke Kemenkes bersama dua daerah lain (Sidoarjo dan Gresik), kata Fikser kepada Radio Suara Surabaya, Senin pagi.</p><p><br></p><p><br></p><p>Untuk itu, saat ini Pemkot Surabaya masih melakukan fiksasi data jumlah MBR dan menyiapkan stimulan ekonomi yang perlu diberikan agar bantuan kepada tersebut dapat tepat sasaran dalam pendistribusian.</p><p><br></p><p>Selain faktor ekonomi, lanjut Fikser, Pemkot Surabaya juga sedang membahas tentang pembatasan wilayah terutama akses masuk bagi masyarakat luar kota. Menurutnya, pembatasan wilayah tersebut tidak diatur di Peraturan Gubernur, sehingga harus disiapkan oleh kabupaten/kota melalui Peraturan Walikota atau Peraturan Bupati masing-masih wilayah PSBB.</p><p><br></p><p>Yang harus disusun kabupaten/kota adalah perbatasan, seperti Surabaya-Gresik, Surabaya-Sidoarjo, ini tidak diatur dalam Pergub. Perwali yang diatur perbatasan, bagaimana akses orang dari kota satu ke kota lain yang masuk wilayah PSBB. Teknisnya nanti seperti apa akan dibahas, tambahnya.</p><p><br></p><p>Saat ditanya kapan kemungkinan penerapan PSBB akan diberlakukan, Fikser belum mengetahui pasti namun diharapkan segera.</p><p><br></p><p>Menurutnya, rapat antara Gubernur Jatim beserta tiga kepala daerah membuktikan bahwa semua pimpinan daerah sangat memperhatikan penerapan PSBB di Kota Surabaya, Sidoarjo dan Gresik. Semua pihak berupaya keras agar kajian tiap daerah segera diselesaikan sehingga segera dapat diajukan ke Kemenkes.</p><p><br></p><p>Dari diskusi kemarin para pimpinan punya concern yang besar. Keputusan yang diambil Ibu Gubernur semua mengikuti agar proses ini disetujui Kemenkes. Kita siapkan ini, sepertinya segera. Minggu ini harusnya selesai, ujarnya.</p><p><br></p><p>Ia berharap, jika nantinya PSBB resmi diterapkan selama 14 hari, maka proses itu dapat dilakukan secara maksimal dan efektif. Untuk itu, diperlukan persiapan yang matang untuk mengantisipasi dampaknya dari banyak sektor.</p><p><br></p><p>Hari ini kami harus mengajukan yang berhubungan transportasi bagaimana, pendidikan, ekonomi. Hari ini semua diharapkan ke Satuan Gugus Provinsi, diharapkan hari ini bisa disampaikan, kata Fikser.</p><p><br></p><p>Seperti yang diketahui, pada Minggu kemarin Khofifah Indar Parawansa Gubernur Jatim mengadakan pertemuan dengan tiga kepala daerah dari Surabaya, Sidoarjo dan Gresik di gedung Grahadi, untuk membahas kemungkinan penerapan PSBB di tiga wilayah tersebut. Dari hasil pertemuan tersebut, ketiga kepala daerah sepakat untuk pemberlakukan PSBB.</p><p><br></p><p>Berdasarkan data terakhir penyebaran Covid-19 di Jawa Timur pada Minggu (19/4/2020), tercatat ada 588 kasus positif Covid-19 di Jawa Timur, yang mana separuhnya berasal dari Surabaya dengan 299 kasus. Sedangkan Sidoarjo dengan jumlah kasus terbanyak kedua yakni 57 kasus, Lamongan 28 kasus dan Gresik 20 kasus.(tin)</p>', '2020-04-20 02:25:29', NULL, 1, 'Pemkot-Surabaya-Siapkan-Kajian-Sosial-Ekonomi-Penerapan-PSBB', '3b6b1fc65524a29f447c052dfb5077a7.jpg'),
(21, 'Lumbung Pangan Jatim Dibuka 21 April dengan Sistem Pesan Antar', 'Berita', '<p>Lumbung Pangan Jawa Timur di Gedung JX International, Jalan Ahmad Yani, Surabaya, siap dibuka pada 21 April, untuk menyediakan bahan kebutuhan pokok murah bagi warga terdampak Covid-19.</p><p><br></p><p>Gubernur Jatim Khofifah Indar Parawansa mengungkapkan bahwa Lumbung Pangan Jatim disediakan bagi masyarakat yang terdampak sosial ekonomi pandemik virus corona (Covid-19).</p><p><br></p><p>Ini cara Pemerintah Provinsi Jatim untuk menyediakan sembako dengan harga di bawah rata-rata bagi masyarakat yang terdampak sosial ekonomi Covid-19, kata Khofifah saat konferensi pers di Gedung Negara Grahadi Surabaya, Minggu (19/4/2020) malam.</p><p><br></p><p>Mantan Menteri Sosial itu memastikan berbagai kebutuhan pokok yang tersedia Lumbung Pangan Jawa Timur dapat dipesan secara pre-order (PO) dan masyarakat bisa mengambilnya melalui layanan drive through yang telah disediakan di lokasi JX International Surabaya.</p><p><br></p><p>Selain itu, Khofifah menandaskan, berbagai kebutuhan pokok di Lumbung Pangan Jatim juga bisa dipesan secara online atau dalam jaringan (daring) dengan transportasi bebas ongkos kirim bagi masyarakat yang berlokasi sekitar 20 kilometer dari Gedung JX International.</p><p><br></p><p>Itu untuk mengantisipasi physical distancing. Masyarakat datang langsung ke lokasi Lumbung Pangan Jatim di Gedung JX International juga boleh. Sudah diatur jarak dua meter satu sama lain, khsususnya saat pembayaran di kasir, ujarnya dilansir Antara.</p><p><br></p><p>Erlangga Satriagung Direktur Utama PT Panca Wira Usaha Jawa Timur memastikan berbagai barang kebutuhan pokok yang tersedia di Lumbung Pangan Jatim harganya di bawah harga pasar.</p><p><br></p><p>Ada beberapa jenis komoditas yang sudah kami siapkan, seperti beras medium dan premium. Harganya beda sekitar Rp500 perkilogram dari harga pasar, katanya.</p><p><br></p><p>Begitu juga untuk komoditas minyak goreng, Lumbung Pangan Jatim telah menyediakan beberapa merek dengan perbedaan harga sekitar Rp500 hingga Rp700 dari harga pasar.</p><p><br></p><p>Selain itu, telur ayam dijual dengan perbedaan harga sekitar Rp3.000 dari harga pasar.</p><p><br></p><p>Menurut pimpinan holding company dari Wira Jatim Group, yang merupakan Badan Usaha Milik Daerah (BUMD) Pemerintah Provinsi Jawa Timur itu, komoditas yang dijual paling murah adalah gula, dengan perbandingan harga mencapai Rp6.000 dari harga pasar.</p><p><br></p><p>Untuk pembelian komoditas gula akan kita batasi, yaitu setiap orang hanya diperbolehkan membeli paling banyak 2 kilogram, ujarnya.(ant/tin/rst)</p>', '2020-04-20 02:26:29', NULL, 1, 'Lumbung-Pangan-Jatim-Dibuka-21-April-dengan-Sistem-Pesan-Antar', 'cf148aa5896839d943f4fff902c577a9.jpg'),
(22, 'Seniman dan Juru Rawat Cagar Budaya Jatim Terdampak Covid-19 Dapat Bantuan', 'Berita', '<p dir=\"ltr\" style=\"margin-bottom: 15px; font-size: 17px; line-height: 1.65; color: rgb(101, 101, 101); font-family: Lato, sans-serif;\">Sejumlah seniman dan juru pelihara cagar budaya di Jatim terdampak Covid-19. Sejumlah tanggapan (job) yang menjadi ladang pendapatan seniman dibatalkan di masa pandemi.</p><p dir=\"ltr\" style=\"margin-bottom: 15px; font-size: 17px; line-height: 1.65; color: rgb(101, 101, 101); font-family: Lato, sans-serif;\">Banyak job seniman yang dibatalkan akibat pandemi corona ini. Semoga corona segera berakhir, Aamin, ujar Lupus, salah satu seniman Ludruk Jatim, di Gedung Negara Grahadi, Minggu (19/4/2020).</p><p dir=\"ltr\" style=\"margin-bottom: 15px; font-size: 17px; line-height: 1.65; color: rgb(101, 101, 101); font-family: Lato, sans-serif;\">Khofifah Indar Parawansa Gubernur Jatim memberikan apresiasi kepada para seniman yang selama ini berdedikasi dan mengabdikan dirinya untuk pengembangan seni budaya daerah di Jawa Timur.</p><div class=\"component-box\" style=\"margin-bottom: 0px; color: rgb(101, 101, 101); font-family: Lato, sans-serif; font-size: 16px;\"><div class=\"ads-wrapper\" style=\"margin: 30px 0px;\"><div class=\"ads\"><div id=\"div-gpt-ad-multibanner1\" data-google-query-id=\"CLf266n69egCFfERtwAd9eYGWA\"><div id=\"google_ads_iframe_/160553881/Suarasurabaya/Default_3__container__\" style=\"border: 0pt none; margin: auto; text-align: center; width: 728px; height: 250px;\"><iframe frameborder=\"0\" src=\"https://tpc.googlesyndication.com/safeframe/1-0-37/html/container.html\" id=\"google_ads_iframe_/160553881/Suarasurabaya/Default_3\" title=\"3rd party ad content\" name=\"\" scrolling=\"no\" marginwidth=\"0\" marginheight=\"0\" width=\"728\" height=\"250\" data-is-safeframe=\"true\" sandbox=\"allow-forms allow-pointer-lock allow-popups allow-popups-to-escape-sandbox allow-same-origin allow-scripts allow-top-navigation-by-user-activation\" data-google-container-id=\"4\" data-load-complete=\"true\" style=\"margin: 0px auto; display: block; max-width: 100%; border-width: 0px; border-style: initial; vertical-align: bottom;\"></iframe></div></div></div></div></div><p dir=\"ltr\" style=\"margin-bottom: 15px; font-size: 17px; line-height: 1.65; color: rgb(101, 101, 101); font-family: Lato, sans-serif;\">Sebenarnya, pemberian apresiasi kepada para seniman ini rutin dilakukan Pemprov Jatim setiap tahunnya. Biasanya setelah Puasa Ramadhan. Karena pandemi, apresiasi itu diberikan lebih awal.</p><p dir=\"ltr\" style=\"margin-bottom: 15px; font-size: 17px; line-height: 1.65; color: rgb(101, 101, 101); font-family: Lato, sans-serif;\">Tidak hanya kepada seniman berprestasi, Pemprov juga memberikan apresiasi atau bantuan kepada juru pelihara cagar budaya di Jawa Timur. Seremoni pemberian apresiasi itu berlangsung Minggu sore.</p><p dir=\"ltr\" style=\"margin-bottom: 15px; font-size: 17px; line-height: 1.65; color: rgb(101, 101, 101); font-family: Lato, sans-serif;\">Apresiasi berupa uang tunai dan sembako itu diberikan kepada 750 orang seniman berprestasi senilai Rp1 juta per orang. Sedangkan 240 orang juru pelihara cagar budaya mendapat Rp1.050.000 per orang.</p><p dir=\"ltr\" style=\"margin-bottom: 15px; font-size: 17px; line-height: 1.65; color: rgb(101, 101, 101); font-family: Lato, sans-serif;\">Semoga apresiasi ini dapat meringankan ekonomi mereka selama menghadapi pandemi Covid-19 ini, kata Khofifah Indar Parawansa Gubernur Jatim di hadapan seniman dan para juru pelihara cagar budaya.</p><p dir=\"ltr\" style=\"margin-bottom: 15px; font-size: 17px; line-height: 1.65; color: rgb(101, 101, 101); font-family: Lato, sans-serif;\">Atas anjuran pemerintah tentang physical distancing, maka apreasiasi untuk para seniman dan juru pelihara cagar budaya itu akan disalurkan melalui paket pos atau transfer ke rekening masing-masing.</p><p dir=\"ltr\" style=\"margin-bottom: 15px; font-size: 17px; line-height: 1.65; color: rgb(101, 101, 101); font-family: Lato, sans-serif;\">Lupus pun mengapresiasi bantuan yang diberikan Gubernur Jatim. Biasanya saya sebagai seniman menghibur pemerintah dan banyak orang. Sekarang giliran pemerintah yang menghibur kami, ujarnya</p><p dir=\"ltr\" style=\"margin-bottom: 15px; font-size: 17px; line-height: 1.65; color: rgb(101, 101, 101); font-family: Lato, sans-serif;\">Berikut ini nama para seniman penerima bantuan dari Gubernur Jawa Timur.</p><p dir=\"ltr\" style=\"margin-bottom: 15px; font-size: 17px; line-height: 1.65; color: rgb(101, 101, 101); font-family: Lato, sans-serif;\">1. Lupus ( Ludruk/Surabaya )<br>2. Bu Nonik (Ludruk/Surabaya)<br>3. Kartolo (Ludruk/Surabaya)<br>4. Sapari (Ludruk/Surabaya)<br>5. Ndemo (Ludruk/Pasuruan)<br>6. Bu Tina (Ludruk/Mojokerto)<br>7. Marsiam (Rupa/Madura )<br>8. Budi Bi (Rupa/Surabaya)<br>9. Aime ( Rupa/Surabaya)<br>10. Anang Timur (Rupa/Surabaya)<br>11. Aris Darmawan (Rupa/Surabaya)<br>12. Aris Daboel (Rupa/Gresik )<br>13. Nasar Bathati (Musik/Sidoarjo )<br>14.Dedy Obenk (Teater/Gresik )<br>15. Yoyok Fals (Musik/Pasuruan)<br>16. Saryono (Tari/Surabaya)</p><p dir=\"ltr\" style=\"margin-bottom: 15px; font-size: 17px; line-height: 1.65; color: rgb(101, 101, 101); font-family: Lato, sans-serif;\">Adapun juru pelihara cagar budaya yang menerima bantuan dari Pemprov antara lain.</p><p dir=\"ltr\" style=\"margin-bottom: 15px; font-size: 17px; line-height: 1.65; color: rgb(101, 101, 101); font-family: Lato, sans-serif;\">1. R. Slamet Acep Makam Pangeran Tengah Arosbaya Kab. Bangkalan<br>2. Adi Purwanto Makam Sunan Giri Kab. Gresik<br>3. Hartono Makam Putri Cempa Kab. Mojokerto<br>4. Semin Candi Pari Kab. Sidoarjo<br>5. R. Moch Zainul Aziz Makam Sunan Drajat Kab. Lamongan.(den)</p>', '2020-04-20 02:29:18', NULL, 1, 'Seniman-dan-Juru-Rawat-Cagar-Budaya-Jatim-Terdampak-Covid-19-Dapat-Bantuan', 'a227bbc53226b18d4a18f9ba654cfc6c.jpg'),
(23, 'SE Protokol Pengendalian Mobilitas Penduduk', 'Pengumuman', '<p><span style=\"color: rgb(101, 101, 101); font-family: Lato, sans-serif; font-size: 16px;\">Surat edaran (SE) protokol pengendalian mobilitas penduduk yang dikirimkan kepada Ketua RT, pengelola apartemen, pengelola country house, dan pengurus REI Jawa Timur. Foto: Istimewa</span><br></p>', '2020-04-20 02:33:17', NULL, 1, 'SE-Protokol-Pengendalian-Mobilitas-Penduduk', 'bbb203c809af66c3eaa798ef500a1460jpeg'),
