(1, 'visimisi', 'VISI MISI KELURAHAN KARAH', '<div class=\"features wow bounceInUp clearfix\">\r\n            <center><i class=\"fa fa-diamond\" style=\"color: #f058dc;\"></i><h4><b>VISI</b></h4>\r\n            <p>TERDEPAN DALAM PELAYANAN KITA CIPTAKAN KECAMATAN JAMBANGAN BERSIH DAN HIJAU</p>\r\n        </center></div>\r\n        <div class=\"features wow bounceInUp clearfix\">\r\n            <center><i class=\"fa fa-diamond\" style=\"color: #589af1;\"></i><h4><b>MISI</b></h4></center>\r\n            <ol>\r\n              <li><div>MENINGKATKAN SISTEM PEMERINTAHAN YANG DEMOKRATIS, BERKEADILAN DAN TRANSPARAN</div></li>\r\n              <li><div>MEWUJUDKAN PENATAAN LINGKUNGAN MASYARAKAT YANG BERSIH, HIJAU DAN INDAH</div></li>\r\n              <li><div>MENINGKATKAN KESEJAHTERAAN MASYARAKAT MELALUI PEMBANGUNAN SOSIAL MASYARAKAT DAN SEKTOR INFORMAL</div></li>\r\n              <li><div>MENGEMBANGKAN KEHIDUPAN MASYARAKAT YANG HARMONIS DAN BERTOLERANSI</div></li>\r\n            </ol>\r\n        </div>', NULL, '2020-04-13 01:30:50', '2020-04-13 01:52:47'),
(2, 'visimisipkk', 'VISI MISI TP-PKK', '<div class=\"features wow bounceInUp clearfix\">\r\n            <center><i class=\"fa fa-diamond\" style=\"color: #f058dc;\"></i><h4><b>VISI</b></h4>\r\n            <p>TERWUJUDNYA KELUARGA YANG BERIMAN DAN BERTAQWA KEPADA TUHAN YANG MAHA ESA, BERAKHLAK MULIA DAN BERBUDI LUHUR, SEHAT SEJAHTERA, LAHIR DAN BATIN</p>\r\n        </div>\r\n        <div class=\"features wow bounceInUp clearfix\">\r\n            <center><i class=\"fa fa-diamond\" style=\"color: #589af1;\"></i><h4><b>MISI</b></h4></center>\r\n            <ol>\r\n              <li><div>MENINGKATKAN PEMBENTUKAN KAREKTER KELUARGA MELALUI PENGHAYATAN, PENGAMALAN PANCASILA, KEGOTONG ROYONGAN SERTA KESETARAAN DAN KEADILAN GENDER.</div></li>\r\n              <li><div>MENINGKATKAN PENDIDIKAN DAN EKONOMI KELUARGA MELALUI BERBAGAI UPAYA KETRAMPILAN DAN PENGEMBANGAN KOPERASI</div></li>\r\n              <li><div>MENINGKATKAN KETAHANAN KELUARGA MELALUI PEMENUHAN PANGAN, SANDANG DAN PERUMAHAN SEHAT DAN LAYAK HUNI.</div></li>\r\n              <li><div>MENINGKATKAN PENGELOLAAN GERAKAN PKK MELIPUTI KEGIATAN PENGORGANISASIAN DAN PENINGKATAN SUMBER DAYA MANUSIA.</div></li>\r\n            </ol>\r\n        </div>', NULL, '2020-04-20 04:22:54', NULL),
(3, 'tujuan', 'TUJUAN PKK', 'GERAKAN PKK BERTUJUAN MEMEBERDAYAKAN KELUARAGA UNTUK MENINGKATKAN KESEJAHTERAAN MENUJU TERWUJUDNYA KELUARGA YANG BERIMAN DAN BERTAQWA KEPADA TUHAN YANG MAHA ESA, BERAKHLAK MULIA DAN BERBUDI LUHUR, SEHAT SEJAHTERA, LAHIR DAN BATIN.', NULL, '2020-04-20 04:22:54', NULL),
(4, 'sejarah', 'SEJARAH PKK', '<p class=\"description\">PKK yang merupakan gerakan pembangunan masyarakat, bermula dari Seminar Home Economic di Bogor pada tahun 1957, yang menghasilkan rumusan 10 Segi Kehidupan Keluarga.<br><br>\r\n                  Kemudian ditindaklanjuti oleh Kementerian Pendidikan, Pengajaran dan Kebudayaan pada tahun 1961, yang menetapkan 10 Segi Kehidupan Keluarga sebagai Kurikulum Pendidikan Kesejahteraan Keluarga yang diajarkan di sekolah-sekolah dan Pendidikan Masyarakat  (PENMAS) sampai sekarang. <br><br>\r\n                  Pada bulan Mei 1962 di Desa Salaman Kabupaten Magelang, Provinsi Jawa Tengah, didirikan Pusat Latihan Pendidikan Masyarakat (PLPM) untuk menyebarluaskan 10 Segi Kehidupan Keluarga.<br><br>\r\n                  Sekitar tahun 1967 kehidupan sebagian masyarakat Jawa Tengah sangat menyedihkan dan memprihatinkan, khususnya daerah Dieng, Kabupaten Wonosobo. Diantara mereka, banyak yang menderita <b>Honger Odeem (HO)</b>.<br><br>\r\n                  Kenyataan itu menyentuh hati Ibu Isriati Moenadi, sebagai Isteri Gubernur Jawa Tengah saat itu. Beliau merasa bertanggung jawab terhadap kesejahteraan masyarakatnya, dan berinisiatif membentuk PKK di Jawa Tengah, dari tingkat Provinsi sampai Desa dan Kelurahan. Dengan susunan pengurus, terdiri dari Isteri Pimpinan Daerah, Tokoh Masyarakat, perempuan dan laki-laki, untuk melaksanakan 10 Segi Pokok PKK secara intensif.<br><br>\r\n                  Dari keberhasilan PKK di Jawa Tengah, maka Presiden RI mengajukan kepada Menteri Dalam Negeri, Bapak Amir Machmud, agar PKK dilaksanakan di daerah-daerah seluruh Indonesia.<br><br>\r\n                  Pada tanggal 27 Desember 1992 Menteri Dalam Negeri mengirimkan Surat Kawat Menteri Dalam Negeri Nomor : SUS 3/6/12 tanggal 27 Desember 1972 kepada Gubernur Jawa Tengah, dengan tembusan kepada Gubernur seluruh Indonesia.<br><br>\r\n                  Sejak tahun 1974, Ketua PKK Jawa Tengah, Ibu Kardinah Soepardjo Roestam banyak menerima tamu dari Luar Negeri seperti : Pakistan, Burma, Malaysia,  dan lain-lain, untuk belajar mengenai PKK.<br><br>\r\n                  Pada tahun 1978, Gubernur Jawa Tengah, Bapak Soepardjo Roestam melaporkan kepada Menteri Dalam Negeri tentang hasil Lokakarya Pembudayaan 10 Segi Pokok PKK menjadi 10 Program Pokok PKK, yang sampai sekarang menjadi Program Gerakan PKK.<br><br>\r\n                  Tujuan Gerakan PKK untuk mencapai keluarga sejahtera dengan tidak membeda-bedakan golongan, agama, partai dan lain-lain. Hal ini menarik perhatian Pemerintah, yang selanjutnya Gerakan Pembinaan Kesejahteraan Keluarga (PKK) diatur dan dibina oleh Departemen Dalam Negeri. Berdasarkan Keputusan Presiden No. 28 Tahun 1980, tentang Perubahan LSD menjadi Lembaga Ketahanan Masyarakat Desa (LKMD) dan PKK  sebagai seksi ke 10 di LKMD.<br><br>\r\n                  Berdasarkan Keputusan Menteri Dalam Negeri No. 4 Tahun 1982, Tim Penggerak PKK Pusat dibentuk dan dipimpin oleh Ibu Amir Machmud, Isteri Menteri Dalam Negeri pada tahun 1982.<br><br>\r\n                  Sebagai langkah selanjutnya, diadakan pemantapan Gerakan PKK, baik tentang pengelolaan dan pengorganisasiannya maupun program kerja dan administrasi melalui Pelatihan, Orientasi, RAKON dan RAKERNAS.<br><br>\r\n                  RAKERNAS I PKK diadakan pada bulan Maret 1982. Selanjutnya pada tahun 1983 dibawah pimpinan dan pengorganisasian Ibu Kardinah Soepardjo Roestam, melaksanakan RAKERNAS II PKK untuk memantapkan kelembagaan PKK dengan 10 Program Pokok PKK nya.<br><br>\r\n                  Setiap tahun diadakan Rapat Konsultasi, dan lima tahun sekali diselenggarakan Rapat Kerja Nasional (RAKERNAS) PKK.<br><br>\r\n                  Kemudian pada Sidang Umum MPR tahun 1983, berdasarkan TAP MPR No. II/MPR/1983 tentang Pembinaan Kesejahteraan Keluarga ditetapkan sebagai salah satu wahana untuk meningkatkan Peranan Wanita Dalam Pembangunan.<br><br>\r\n                  Pada  Tahun 1984, Menteri dalam Negeri menerbitkan Surat Keputusan No. 28 Tahun 1984 tentang Pembinaan Kesejahteraan Keluarga (PKK) yang menetapkan tentang pengertian, tujuan, sasaran, fungsi, tugas Gerakan PKK dan ketentuan atributnya.<br><br>\r\n                  Tahun 1987, atas persetujuan Presiden RI, dibentuk Kelompok-Kelompok PKK Dusun/Lingkungan, RW, RT dan Kelompok Dasa Wisma, guna meningkatkan pembinaan warga dalam melaksanakan 10 Program Pokok PKK dan mulai tahun 1988, PKK mendapatkan penghargaan- penghargaan Internasional seperti Maurice Pate, Sasakawa Health Price, maupun penghargaan Tingkat Nasional untuk kegiatan-kegiatan yang dilakukan selama ini antara lain dalam bidang : Kesehatan, Pendidikan, Keluarga Berencana, Lingkungan Hidup, dan lainnya.<br><br>\r\n                  RAKERNAS III PKK dilaksanakan pada saat dipimpin oleh Ketua Umum Ibu KArdinash Soepardjo Rustam pada tahun 1988, memantapkan pelaksanaan program-program PKK dan mendapatkan penghargaan Hari Bumi Sedunia di Miami, Amerika.<br><br>\r\n                  Pada tahun 1993, dalam Rakernas IV, yang dipimpin oleh KEtua Umum Ny. Odiana Rudini telah memutuskan untuk MENETAPKAN TANGGAL 27 DESEMBER SEBAGAI HARI KESATUAN GERAK PKK, yang diperingati setiap tahun.<br><br>\r\n                  Pada bulan Desember 1997, Tim Penggerak PKK Pusat menyelenggarakan Jambore Kader Posyandu, yang diikuti oleh Kader-kader PKK dari 27 Provinsi, Kabupaten/Kota, Desa/Kelurahan.<br><br>\r\n                  RAKERNAS V diadakan pada tahun 1998 dipimpin oleh KEtua Umum Ny. Emy Yogie S.M.<br><br>\r\n                  Dalam acara tersebut, Menteri Dalam Negeri, Yogie S.M, selaku Pembina PKK, memberikan penghargaan kepada Pelindung, Penasihat, Kader-kader PKK yang telah berpartisipasi selama 25 tahun atau lebih, 15 tahun dan 10 tahun tanpa terhenti :<br>\r\n                  <ul type=\"disc\">\r\n                    <li class=\"description\">Medali Tertinggi PARAMAHITA NUGRAHA</li>\r\n                    <li class=\"description\">Medai Utama ADHI BHAKTI UTAMA</li>\r\n                    <li class=\"description\">Medali Madya ADHI BHAKTI MADYA</li>\r\n                  </ul>\r\n                </p>\r\n                <p class=\"description\">\r\n                  Sesuai dengan Era Reformasi dan GBHN 1999 serta Otonomi Daerah berdasarkan UU No. 22 tahun 1999 , maka Tim Penggerak PKK Pusat telah menyelenggarakn Rapat Kerja Nasional Luar Biasa PKK, pada tanggal 31 Oktober  2 November 2000, di Bandung, yang dipimpin oleh Ibu Suryadi Sudirdja, yang menghasilkan pokok-pokok kesepakatan antara lain, adalah pengertian dan nomenklatur Gerakan PKK berupa dari Pembinaan Kesejahteraan Keluarga menjadi Pemberdayaan dan Kesejahteraan Keluarga, disingkat PKK dan adanya Badan Penyantun TP. PKK disemua tingkatan.<br><br>\r\n                  Hasil Kesepakatan Rakernaslub PKK tersebut, selanjutnya ditetapkan menjadi Keputusan Menteri Dalam Negeri dan Otonomi Daerah No. 53 Tahun 2000, tentang  Gerakan Pemberdayaan dan Kesejahteraan Keluarga (PKK). Dengan dasar Kemendagri tersebut, selanjutnya disusunlah Pedoman Umum Gerakan PKK sebagai panduan pelaksanaan Gerakan PKK, sampai saat ini.<br><br>\r\n                  Pada tahun 2005, TP PKK Pusat mengadakan Rakernas VI PKK, dipimpin oleh Ketua Umum Ibu Susiyati Maruf, menetapkan perubahan nama Badan Penyantun PKK menjadi Dewan Penyantun PKK, serta adanya Seragam PKK Nasional.<br><br>\r\n                  Pada tahun 2010 diselenggarakan Rakernas VII PKK dipimpin oleh Ketua Umum Ibu Hj. Vita Gamawan Fauzi, SH yang menghasilkan rumusan antara lain tentang : Penyesuaian dan penetapan Hari Kesatuan Gerak PK dari tanggal 27 Desember manjasi 4 Maret.<br><br>\r\n                  Pada tahun 2013, diterbitkan Peraturan Menteri Dalam Negeri No. 1 Tahun 2013 tentang Pemberdayaan Masyarakat melalui Gerakan Pemberdayaan dan Kesejahteraan Keluarga.<br><br>\r\n                  Hal mendasar yang diatur dalam Permendagri tersebut adalah :<br>\r\n                  <ul type=\"disc\">\r\n                    <li class=\"description\">Pembinaan dan pengawasan terhadap Pemberdayaan MAsyarakat melalui Gerakan PKK ada di Institusi yang membidangi Pemberdayaan Masyarakat.</li>\r\n                    <li class=\"description\">Sebutan Dewan Penyantun menjadi Pembina sehingga Menteri Dalam Negeri menjadi Ketua Pembina TP. PKK Pisat, Gubernur Ketua Pembina TP. PKK Provinsi samapai dengan Kepala Desa/Lurah sebagai Ketua Pembina di wilayahnya masing-masing.</li>\r\n                  </ul>\r\n                </p>', NULL, '2020-05-05 15:03:05', NULL),
(5, 'strukturorganisasi', 'Struktur Organisasi', '', 'd6fe481da261415f298ae28040e60afe.png', '2020-06-03 11:59:22', '2020-06-03 12:19:52'),
(6, '10programpokok', '10 PROGRAM POKOK PKK', '<h4 class=\"title\"><br></h4>\r\n                  <ol>\r\n                      <li class=\"description\">Penghayatan dan Pengamatan Pancasila</li>\r\n                      <li class=\"description\">Gotong Royong</li>\r\n                      <li class=\"description\">Pangan</li>\r\n                      <li class=\"description\">Sandang</li>\r\n                      <li class=\"description\">Perumahan dan Tata Laksana Rumah Tangga</li>\r\n                      <li class=\"description\">Pendidikan dan Ketrampilan</li>\r\n                      <li class=\"description\">Kesehatan</li>\r\n                      <li class=\"description\">Pengembangan Kehidupan Berkoprasi</li>\r\n                      <li class=\"description\">Kelestarian Lingkungan Hidup</li>\r\n                      <li class=\"description\">Perencanaan Sehat</li>\r\n                  </ol>', NULL, '2020-06-03 14:45:49', '2020-06-04 02:14:05'),
(7, 'marspkk', 'MARS PKK KARAH', '<p class=\"description\">\r\n                  Marilah hai semua Rakyat Indonesia<br>\r\n                  membangun segra <br>\r\n                  Membangun kluarga yang sejahtera <br>\r\n                  dengan PKK <br>\r\n                </p>\r\n                <br>\r\n                <p class=\"description\">\r\n                  Hayatilah dan amalkan Pancasila <br>\r\n                  untuk Negara<br>\r\n                  Hidup gotong royong, makmur pangan dan sandang<br>\r\n                  rumah sehat sentosa<br>\r\n                </p>\r\n                <br>\r\n                <p class=\"description\">\r\n                  Tata laksana di dalam rumah tangga<br>\r\n                  rapi dan indah<br>\r\n                  Didiklah putra berpribadi bangsa<br>\r\n                  trampil dan sehat<br>\r\n                </p>\r\n                <br>\r\n                <p class=\"description\">\r\n                  Kembangkan koprasi jagalah lingkungan <br>\r\n                  dan sekitarnya<br>\r\n                  Aman dan bahagia kluarga berencana <br>\r\n                  Hidup jaya PKK <br>\r\n                </p>', NULL, '2020-06-03 15:43:30', '2020-06-04 02:08:12'),
(8, 'artikeseluruhan', 'Arti Keseluruhan', '<p class=\"cta-text\">Pemberdayaan dan Kesejahteraan Keluarga (PKK) yang merupakan gerakan nasional untuk pembangunan keluarga, berazaskan Pancasila dan UUD 1945 dan bertaqwa \r\n                  kepada Tuhan Yang Maha Esa, melakukan kegiatan yang terus menerus dan berkesinambungan untuk menghimpun, menggerakan dan membina masyarakat dengan melaksanakan 10 Program\r\n                   Pokok PKK dengan sasaran keluarga sebagai unit terkecil dalam masyarakat untuk mewujudkan keluarga sejahtera yang selalu hidup dalam suasana damai, aman, tertib, tenteram, \r\n                   makmur dan sejahtera dalam rangka Ketahanan Nasional.</p>', NULL, '2020-06-04 01:35:36', NULL),
(9, 'artibentuk', 'Bentuk', '<p class=\"description\">Akolade melingkar segi lima dalam arti Pancasila sebagai dasar Gerakan PKK </p>\r\n                <ol>\r\n                    <li class=\"description\">Bintang</li>\r\n                    <li class=\"description\">17 Butir Kapas, 8 Simpul Pengikat, dan 45 Butir Padi</li>\r\n                    <li class=\"description\">Akolade Melingkar</li>\r\n                    <li class=\"description\">Rangkaian Mata Rantai</li>\r\n                    <li class=\"description\">Lingkarang putih dengan tulisan Pemberdayaan Kesejahteraan Keluarga, berwarna hitam</li>\r\n                    <li class=\"description\">10 buah ujung tombak yang tersusun merupakan bunga</li>\r\n                </ol>', NULL, '2020-06-04 01:48:22', NULL),
(10, 'artiwarna', 'Warna', '<p class=\"description\">Warna lambang terdiri dari :</p>\r\n                  <ol>\r\n                      <li class=\"description\">Warna dasar lambang</li>\r\n                      <li class=\"description\">Warna kuning yang dimaksud adalah warna kuning emas, untuk :\r\n                          <ul type=\"disc\">\r\n                              <li>Gambar Bintang</li>\r\n                              <li>Gambar Padi</li>\r\n                              <li>Gambar Rantai</li>\r\n                              <li>Gambar Kelopak Bunga</li>\r\n                              <li>Gambar Tangkai Padi dan Tangkai Kapas</li>\r\n                              <li>Gambar Akolade Segi Lima</li>\r\n                          </ul>\r\n                      </li>\r\n                      <li class=\"description\">Warna putih yang dimaksud adalah : \r\n                          <ul type=\"disc\">\r\n                              <li>Putih Perak Untuk :\r\n                                  <ol>\r\n                                      <li>Gambar 10 mata tombak dalam lingkaran paling dalam</li>\r\n                                      <li>Gambar alokade melingkar</li>\r\n                                      <li>Gambar bunga kapas</li>\r\n                                      <li>Delapan simpul pengikat tangkai padi dan kapas</li>\r\n                                  </ol>\r\n                              </li>\r\n                              <li>Putih Kapas Untuk :\r\n                                  <ol>\r\n                                      <li>Lingkaran sebagai dasar tulisan Pemberdayaan dan Kesejahteraan Keluarga</li>\r\n                                      <li>Bunga Kapas khusus yang dicetak pada logam</li>\r\n                                  </ol>\r\n                              </li>\r\n                          </ul>\r\n                      </li>\r\n                  </ol>', NULL, '2020-06-04 01:55:09', NULL),
(11, 'artilambang', 'Arti Lambang', '<p class=\"description\">PKK yang merupakan gerakan pembangunan masyarakat, bermula dari Seminar Home Economic di Bogor pada tahun 1957, yang menghasilkan rumusan 10 Segi Kehidupan Keluarga.<br><br>\r\n                  Kemudian ditindaklanjuti oleh Kementerian Pendidikan, Pengajaran dan Kebudayaan pada tahun 1961, yang menetapkan 10 Segi Kehidupan Keluarga sebagai Kurikulum Pendidikan Kesejahteraan Keluarga yang diajarkan di sekolah-sekolah dan Pendidikan Masyarakat  (PENMAS) sampai sekarang. <br><br>\r\n                  Pada bulan Mei 1962 di Desa Salaman Kabupaten Magelang, Provinsi Jawa Tengah, didirikan Pusat Latihan Pendidikan Masyarakat (PLPM) untuk menyebarluaskan 10 Segi Kehidupan Keluarga.<br><br>\r\n                  Sekitar tahun 1967 kehidupan sebagian masyarakat Jawa Tengah sangat menyedihkan dan memprihatinkan, khususnya daerah Dieng, Kabupaten Wonosobo. Diantara mereka, banyak yang menderita <b>Honger Odeem (HO)</b>.<br><br>\r\n                  Kenyataan itu menyentuh hati Ibu Isriati Moenadi, sebagai Isteri Gubernur Jawa Tengah saat itu. Beliau merasa bertanggung jawab terhadap kesejahteraan masyarakatnya, dan berinisiatif membentuk PKK di Jawa Tengah, dari tingkat Provinsi sampai Desa dan Kelurahan. Dengan susunan pengurus, terdiri dari Isteri Pimpinan Daerah, Tokoh Masyarakat, perempuan dan laki-laki, untuk melaksanakan 10 Segi Pokok PKK secara intensif.<br><br>\r\n                  Dari keberhasilan PKK di Jawa Tengah, maka Presiden RI mengajukan kepada Menteri Dalam Negeri, Bapak Amir Machmud, agar PKK dilaksanakan di daerah-daerah seluruh Indonesia.<br><br>\r\n                  Pada tanggal 27 Desember 1992 Menteri Dalam Negeri mengirimkan Surat Kawat Menteri Dalam Negeri Nomor : SUS 3/6/12 tanggal 27 Desember 1972 kepada Gubernur Jawa Tengah, dengan tembusan kepada Gubernur seluruh Indonesia.<br><br>\r\n                  Sejak tahun 1974, Ketua PKK Jawa Tengah, Ibu Kardinah Soepardjo Roestam banyak menerima tamu dari Luar Negeri seperti : Pakistan, Burma, Malaysia,  dan lain-lain, untuk belajar mengenai PKK.<br><br>\r\n                  Pada tahun 1978, Gubernur Jawa Tengah, Bapak Soepardjo Roestam melaporkan kepada Menteri Dalam Negeri tentang hasil Lokakarya Pembudayaan 10 Segi Pokok PKK menjadi 10 Program Pokok PKK, yang sampai sekarang menjadi Program Gerakan PKK.<br><br>\r\n                  Tujuan Gerakan PKK untuk mencapai keluarga sejahtera dengan tidak membeda-bedakan golongan, agama, partai dan lain-lain. Hal ini menarik perhatian Pemerintah, yang selanjutnya Gerakan Pembinaan Kesejahteraan Keluarga (PKK) diatur dan dibina oleh Departemen Dalam Negeri. Berdasarkan Keputusan Presiden No. 28 Tahun 1980, tentang Perubahan LSD menjadi Lembaga Ketahanan Masyarakat Desa (LKMD) dan PKK  sebagai seksi ke 10 di LKMD.<br><br>\r\n                  Berdasarkan Keputusan Menteri Dalam Negeri No. 4 Tahun 1982, Tim Penggerak PKK Pusat dibentuk dan dipimpin oleh Ibu Amir Machmud, Isteri Menteri Dalam Negeri pada tahun 1982.<br><br>\r\n                  Sebagai langkah selanjutnya, diadakan pemantapan Gerakan PKK, baik tentang pengelolaan dan pengorganisasiannya maupun program kerja dan administrasi melalui Pelatihan, Orientasi, RAKON dan RAKERNAS.<br><br>\r\n                  RAKERNAS I PKK diadakan pada bulan Maret 1982. Selanjutnya pada tahun 1983 dibawah pimpinan dan pengorganisasian Ibu Kardinah Soepardjo Roestam, melaksanakan RAKERNAS II PKK untuk memantapkan kelembagaan PKK dengan 10 Program Pokok PKK nya.<br><br>\r\n                  Setiap tahun diadakan Rapat Konsultasi, dan lima tahun sekali diselenggarakan Rapat Kerja Nasional (RAKERNAS) PKK.<br><br>\r\n                  Kemudian pada Sidang Umum MPR tahun 1983, berdasarkan TAP MPR No. II/MPR/1983 tentang Pembinaan Kesejahteraan Keluarga ditetapkan sebagai salah satu wahana untuk meningkatkan Peranan Wanita Dalam Pembangunan.<br><br>\r\n                  Pada  Tahun 1984, Menteri dalam Negeri menerbitkan Surat Keputusan No. 28 Tahun 1984 tentang Pembinaan Kesejahteraan Keluarga (PKK) yang menetapkan tentang pengertian, tujuan, sasaran, fungsi, tugas Gerakan PKK dan ketentuan atributnya.<br><br>\r\n                  Tahun 1987, atas persetujuan Presiden RI, dibentuk Kelompok-Kelompok PKK Dusun/Lingkungan, RW, RT dan Kelompok Dasa Wisma, guna meningkatkan pembinaan warga dalam melaksanakan 10 Program Pokok PKK dan mulai tahun 1988, PKK mendapatkan penghargaan- penghargaan Internasional seperti Maurice Pate, Sasakawa Health Price, maupun penghargaan Tingkat Nasional untuk kegiatan-kegiatan yang dilakukan selama ini antara lain dalam bidang : Kesehatan, Pendidikan, Keluarga Berencana, Lingkungan Hidup, dan lainnya.<br><br>\r\n                  RAKERNAS III PKK dilaksanakan pada saat dipimpin oleh Ketua Umum Ibu KArdinash Soepardjo Rustam pada tahun 1988, memantapkan pelaksanaan program-program PKK dan mendapatkan penghargaan Hari Bumi Sedunia di Miami, Amerika.<br><br>\r\n                  Pada tahun 1993, dalam Rakernas IV, yang dipimpin oleh KEtua Umum Ny. Odiana Rudini telah memutuskan untuk MENETAPKAN TANGGAL 27 DESEMBER SEBAGAI HARI KESATUAN GERAK PKK, yang diperingati setiap tahun.<br><br>\r\n                  Pada bulan Desember 1997, Tim Penggerak PKK Pusat menyelenggarakan Jambore Kader Posyandu, yang diikuti oleh Kader-kader PKK dari 27 Provinsi, Kabupaten/Kota, Desa/Kelurahan.<br><br>\r\n                  RAKERNAS V diadakan pada tahun 1998 dipimpin oleh KEtua Umum Ny. Emy Yogie S.M.<br><br>\r\n                  Dalam acara tersebut, Menteri Dalam Negeri, Yogie S.M, selaku Pembina PKK, memberikan penghargaan kepada Pelindung, Penasihat, Kader-kader PKK yang telah berpartisipasi selama 25 tahun atau lebih, 15 tahun dan 10 tahun tanpa terhenti :<br>\r\n                  <ul type=\"disc\">\r\n                    <li class=\"description\">Medali Tertinggi PARAMAHITA NUGRAHA</li>\r\n                    <li class=\"description\">Medai Utama ADHI BHAKTI UTAMA</li>\r\n                    <li class=\"description\">Medali Madya ADHI BHAKTI MADYA</li>\r\n                  </ul>\r\n                </p>\r\n                <p class=\"description\">\r\n                  Sesuai dengan Era Reformasi dan GBHN 1999 serta Otonomi Daerah berdasarkan UU No. 22 tahun 1999 , maka Tim Penggerak PKK Pusat telah menyelenggarakn Rapat Kerja Nasional Luar Biasa PKK, pada tanggal 31 Oktober  2 November 2000, di Bandung, yang dipimpin oleh Ibu Suryadi Sudirdja, yang menghasilkan pokok-pokok kesepakatan antara lain, adalah pengertian dan nomenklatur Gerakan PKK berupa dari Pembinaan Kesejahteraan Keluarga menjadi Pemberdayaan dan Kesejahteraan Keluarga, disingkat PKK dan adanya Badan Penyantun TP. PKK disemua tingkatan.<br><br>\r\n                  Hasil Kesepakatan Rakernaslub PKK tersebut, selanjutnya ditetapkan menjadi Keputusan Menteri Dalam Negeri dan Otonomi Daerah No. 53 Tahun 2000, tentang  Gerakan Pemberdayaan dan Kesejahteraan Keluarga (PKK). Dengan dasar Kemendagri tersebut, selanjutnya disusunlah Pedoman Umum Gerakan PKK sebagai panduan pelaksanaan Gerakan PKK, sampai saat ini.<br><br>\r\n                  Pada tahun 2005, TP PKK Pusat mengadakan Rakernas VI PKK, dipimpin oleh Ketua Umum Ibu Susiyati Maruf, menetapkan perubahan nama Badan Penyantun PKK menjadi Dewan Penyantun PKK, serta adanya Seragam PKK Nasional.<br><br>\r\n                  Pada tahun 2010 diselenggarakan Rakernas VII PKK dipimpin oleh Ketua Umum Ibu Hj. Vita Gamawan Fauzi, SH yang menghasilkan rumusan antara lain tentang : Penyesuaian dan penetapan Hari Kesatuan Gerak PK dari tanggal 27 Desember manjasi 4 Maret.<br><br>\r\n                  Pada tahun 2013, diterbitkan Peraturan Menteri Dalam Negeri No. 1 Tahun 2013 tentang Pemberdayaan Masyarakat melalui Gerakan Pemberdayaan dan Kesejahteraan Keluarga.<br><br>\r\n                  Hal mendasar yang diatur dalam Permendagri tersebut adalah :<br>\r\n                  <ul type=\"disc\">\r\n                    <li class=\"description\">Pembinaan dan pengawasan terhadap Pemberdayaan MAsyarakat melalui Gerakan PKK ada di Institusi yang membidangi Pemberdayaan Masyarakat.</li>\r\n                    <li class=\"description\">Sebutan Dewan Penyantun menjadi Pembina sehingga Menteri Dalam Negeri menjadi Ketua Pembina TP. PKK Pisat, Gubernur Ketua Pembina TP. PKK Provinsi samapai dengan Kepala Desa/Lurah sebagai Ketua Pembina di wilayahnya masing-masing.</li>\r\n                  </ul>\r\n                </p>', NULL, '2020-06-04 01:58:02', '2020-06-04 02:12:15');

